// src/components/Featured.tsx
import React from 'react';
import './style.css'; // Assuming you have a CSS file for styling

const Featured: React.FC = () => {
  return (
    <section className="featured">
      <h3>Featured today</h3>
      <div className="featured-thumbnails">
        <img src="path/to/featured-thumbnail1.jpg" alt="Featured 1" />
        <img src="path/to/featured-thumbnail2.jpg" alt="Featured 2" />
        <img src="path/to/featured-thumbnail3.jpg" alt="Featured 3" />
        <img src="path/to/featured-thumbnail4.jpg" alt="Featured 4" />
      </div>
    </section>
  );
};

export default Featured;
